__NUXT_JSONP__("/drugs/Temuterkib_Mesylate", (function(a,b,c,d){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"2365171-00-0",chebiId:b,chemicalFormula:b,definition:"The mesylate salt form of temuterkib, an orally available inhibitor of extracellular signal-regulated kinase (ERK) 1 and 2, with potential antineoplastic activity. Upon oral administration, temuterkib inhibits both ERK 1 and 2, thereby preventing the activation of mitogen-activated protein kinase (MAPK)\u002FERK-mediated signal transduction pathways. This results in the inhibition of ERK-dependent tumor cell proliferation and survival. The MAPK\u002FERK pathway is often upregulated in a variety of tumor cell types and plays a key role in tumor cell proliferation, differentiation and survival.",fdaUniiCode:"34M62WSA87",identifier:"C180622",preferredName:c,semanticType:"Pharmacologic Substance",subclassOf:["C174048"],synonyms:["ERK1\u002F2 Inhibitor LY3214996 Mesylate","LY 3214996 Mesylate","LY-3214996 Mesylate","LY3214996 Mesylate","TEMUTERKIB MESYLATE",c]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FTemuterkib_Mesylate",extension:".json",createdAt:d,updatedAt:d}}],fetch:{},mutations:void 0}}("Temuterkib_Mesylate","","Temuterkib Mesylate","2021-10-30T13:36:44.413Z")));